export default function Home() {
  return (
    <div className="home">
      <div className="home__carrousel"></div>
      <div className="home__article-container">
        <div className="home__article-item"></div>
        <div className="home__article-item"></div>
        <div className="home__article-item"></div>
      </div>
      
    </div>
  );
}
